		<title>
		By: johntshea		</title>
		<link>http://clockworktwist.com/blog/2013/12/01/patrick-reilly/#comment-45</link>

		<dc:creator><![CDATA[johntshea]]></dc:creator>
		<pubDate>Mon, 02 Dec 2013 02:14:55 +0000</pubDate>
		<guid isPermaLink="false">http://clockworktwist.com/?p=1196#comment-45</guid>

					<description><![CDATA[The giant robot is one of the most evocative fantasy paintings I&#039;ve ever seen, and I&#039;ve seen quite a few. But evocative of when? I respect Mr. Reilly&#039;s back story, but my first impression was of a later fantasy period, more Dieselpunk/Pulp/1920s. But I do now note the Victorian details. Awesome in any case, like all his others!
Thanks, Emi-T.
JTS]]></description>
			<content:encoded><![CDATA[<p>The giant robot is one of the most evocative fantasy paintings I&#8217;ve ever seen, and I&#8217;ve seen quite a few. But evocative of when? I respect Mr. Reilly&#8217;s back story, but my first impression was of a later fantasy period, more Dieselpunk/Pulp/1920s. But I do now note the Victorian details. Awesome in any case, like all his others!<br />
Thanks, Emi-T.<br />
JTS</p>
]]></content:encoded>
		
